public static function user_permission($key)
{
    if(Helpers::isPropertyAdmin()){
        $user_permission = \App\Models\UserSetting::where('user_id', \Illuminate\Support\Facades\Auth::id())->where('key', $key)->first()->status;
    } else{
        $user_permission = 1;
    }

